import React from 'react';
import { Link } from 'react-router-dom'
import ItemList from '../item-list';
const PageHome = () =>{
const arr=[
    {
    
    name: 'XiaomI mi Note',
    brand: 'Xiaomi'},
    {}
];
    return (
        <div>
            <p>
                It's Home Page, my dear friend :)
                <br/>
                    <ItemList items={arr}/>
                <br/>
                <Link to='/item'>item page</Link>
            </p>
        </div>
  )
}
export default PageHome;
